export default function Contact(props){
    let contact=props.content;
    return (
        <>
            <div className="h-100">
                <img src="https://booksforbadal.com/wp-content/uploads/2022/03/Contact-Us-banner_1586952394.jpg" className="w-full h-full"></img>
            </div>
            <div className="" id="contact">
                {
                    contact.map((el)=>(
                        <p>{el.label}</p>
                    ))
                }
            </div>
        </>
    )
}
